import Navigation from "../Navigation/Navigation";
import LogonForm from "../LogonForm/LogonForm";

const HomePage = (props) => {
  const {
    verified,
    setVerified,
    signOn,
    setSignOn,
    employee,
    setEmployee,
  } = props;

  return (
    <div className="HomePage">
      <Navigation
        verified={verified}
        setVerified={setVerified}
        signOn={signOn}
        setSignOn={setSignOn}
        employee={employee}
        setEmployee={setEmployee}
      />
      <LogonForm signOn={signOn} setSignOn={setSignOn} setVerified={setVerified} employee={employee} setEmployee={setEmployee}/>
      <div classname="carousel"> a scrolling new release carousel can go here</div>
      <div classbane="body-content">List of best sellers goes here</div>
    </div>
  );
};
export default HomePage;
